import React, { useState } from 'react';
import { DeletarAtividade } from '../utils/home/DeletarAtividade'; // Ajuste o caminho conforme necessário
import Botao from './Botao'; // Supondo que você tenha um componente de botão personalizado

const ConfigDemanda = ({ demanda }) => {
    const [atividadeId, setAtividadeId] = useState(demanda.id); // Inicializa o estado com o ID da atividade

    const handleDelete = () => {
        if (atividadeId) {
            DeletarAtividade(atividadeId, setAtividadeId); // Chama a função para deletar e limpa o estado
        }
    };

    return (
        <div className="menu-suspenso p-3">
            {/* Outros campos de entrada da demanda... */}

            {/* Botão para deletar */}
            <div className="text-end">
                <Botao texto="Deletar" onClick={handleDelete} tipo="btn-delete" />
            </div>
        </div>
    );
};

export default ConfigDemanda;
